import Filters from './Filters'

const ActionBar = props => {

  return (
    <Filters clearFilters={props.clearFilters} onChange={props.changeFilters} activeFilters={props.filters} catalogue={props.catalogue} drawer={props.drawer} toggleDrawer={props.toggleDrawer}/>
  )
}

export default ActionBar
